import React from 'react';
import menu from "../assets/menu.png";

const Navbar = ({ setCurrentPage }) => {
    const handleNavigation = (page) => {
        setCurrentPage(page); // Navigate to the selected page
    };

    return (
        <nav style={{
            position: 'fixed', 
            top: 0,
            left: 0,
            width: '100%',
            display: 'flex',
            justifyContent: 'space-around',
            alignItems: 'center',
            backgroundColor: 'white', // Add a background color if needed
            padding: '10px',
            zIndex: 1000
        }}>
            <div
                onClick={() => handleNavigation('calendar')}
                style={{
                    padding: '10px',
                    borderRadius: '5px',
                    backgroundColor: '#4CAF50',
                    color: '#fff',
                    cursor: 'pointer',
                    fontFamily: 'Dancing Script, cursive'
                }}
            >
                Add Entry
            </div>
            <div
                onClick={() => handleNavigation('viewdata')}
                style={{
                    padding: '10px',
                    borderRadius: '5px',
                    backgroundColor: '#4CAF50',
                    color: '#fff',
                    cursor: 'pointer',
                    fontFamily: 'Dancing Script, cursive'
                }}
            >
                View Entries
            </div>
            <div
                onClick={() => handleNavigation('cards')}
                style={{
                    padding: '10px',
                    borderRadius: '5px',
                    backgroundColor: '#4CAF50',
                    color: '#fff',
                    cursor: 'pointer',
                    fontFamily: 'Dancing Script, cursive'
                }}
            >
                View Timeline
            </div>
            <div
                onClick={() => handleNavigation('profile')}
                style={{
                    padding: '10px',
                    borderRadius: '5px',
                    backgroundColor: '#4CAF50',
                    color: '#fff',
                    cursor: 'pointer',
                    fontFamily: 'Dancing Script, cursive'
                }}
            >
                Profile
            </div>
        </nav>
    );
};

export default Navbar;
